const response = items[0].json;

// Make sure "places" exists
if (!response.places) {
  return [];
}

// Map places to n8n items
return response.places.map(place => ({
  json: {
    id: place.id,
    name: place.displayName?.text,
    types: place.types,
    phoneNational: place.nationalPhoneNumber,
    phoneInternational: place.internationalPhoneNumber,
    address: place.formattedAddress,
    lat: place.location?.latitude,
    lng: place.location?.longitude,
    rating: place.rating,
    totalReviews: place.userRatingCount,
    type: place.primaryType,
    typeDisplayName: place.primaryTypeDisplayName?.text,
    status: place.businessStatus,
    placeName: place.name,                 // e.g. "places/ChIJj61dQgK6j4AR4GeTYWZsKWw"
    languageCode: place.displayName?.languageCode || "en",
    regionCode: response.regionCode || "string",   // comes from API response root if available
    sessionToken: response.sessionToken || "dummy-session-token"
  }
}));
